import React from 'react';
import { Grid, Paper, Typography } from '@material-ui/core';



const styles = {
    paper: {
        padding : "15px",
        margin : "5px",
        marginBottom : "10px"
    }
}

export default ( {exercises }) => {
    return (
        <div>
        <Grid container>
            <Grid item xs>
                <Paper style = {styles.paper}>
                    hi
                </Paper>
        </Grid>
        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography variant = "button" >Right Panel
                    </Typography>
                </Paper>
        </Grid>

        </Grid>
        </div>
    )
}
